script: |
  super -f text -I q1752.spq | sort > q1752.out

inputs:
  - name: q1752.spq
    data: |
      SELECT DISTINCT - 63 * - 30 + - cor0.col1 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab0 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q1752.out
    data: |
      1831
      1859
      1873
